import React from 'react';
import styled from 'styled-components';
import axios from 'axios';


const KanyeQuote = () => {
    const quoteRequest = () => {
        axios
            .get('https://api.kanye.rest')
            .then((res) => {
                console.log(res)
            })
    }
    const handleClick = () => {
        quoteRequest();
    }
    return (
        <div>
            <button></button>
        </div>
    )
}

export default KanyeQuote;


const StyledDiv = styled.div`
margin:2rem;
`
